text:
너무 재밌어요ㅠㅠㅠ
댄석 진짜 &#128077; &#128077;
얼른 웰컴대학로도 시작하면 좋겠어요

뮤지컬 [해적] 댄석 페어를 다시 만나고 왔다. 이 작품은 두 배우가 각자 두 명의 역할을 담당하여 2인극이지만 총 4인극의 느낌을 주는 공연이다. 함께 항해에 떠나게 되는 잭과 루이스, 그리고 그들이 영입하는 총잡이 앤과 검투사 메리의 이야기를 다룬다.

&#8203;

김대현, 최석진 배우님의 페어는 특히 앤과 메리가 너무나도 좋은데, 이 날 공연에서는 두 사람이 마지막 작별을 앞두고 부르는 넘버 "우리 모두의 기억나지 않는 꿈"이 정말 안타까운 공연이었다. 서로를 너무나도 사랑하지만 이별할 수 밖에 없는 두 사람이, 서로 시선을 회피하고, 상대방이 자신을 보지 않고 있을 때에만 드러나는 슬픈 눈빛에...마음이 참 아픈 회차였다.

&#8203;

육지에서는 길을 잃었지만 바다에서는 세상 전부를 가진 것만 같았던 네 사람의 항해 이야기에 자꾸만 마음이 간다.

너무나도 좋았던 공연. 요즘 마지막 넘버에서 캡틴 잭을 기억하며 늘 "캡틴 잭의 뒷모습"을 부르다가 울컥하는 루이스가 너무너무 좋다...ㅠㅠ 이 디테일 남은 기간도 내내 살려주었으면ㅠㅠ

&#8203;

※ 메리와 앤이 처음 만나는 순간, 칼싸움을 하다가 앤의 주머니에서 총이 떨어져나갔다. 순간 메리가 자연스럽게 싸움을 멈추고 땅에서 총을 주울 시간을 주겠다는 신호를 줘서 (손가락으로 총을 가리키며 까딱까딱), 앤이 무사히 총을 집고 다시 싸울 수 있었다. 비록 의도치 않게 일어난 일이었지만, 오히려 이 장면으로 인해 Love at First Sight의 장면이 더욱 완성도가 생긴 것 같아 내적 환호했던ㅠㅠㅠ 서로 싸우고는 있지만 이미 반해버렸고, 또 해적으로써의 자존심을 지키며 정정당당한 승부만을 고수하는 게 진정한 군신이자 전사들임이 틀림없었다!!

뮤지컬 [해적]을 보고왔다. 내가 너무나도 좋아하는 주석페어!! 두 사람이 만나면 후반부의 감정이 워낙 좋아서 많이들 이 페어를 사랑하는 것 같다 (물론 대신 애드립이 엄청 많아서 거기서 튕기는 관객들도 있는 편이다).

&#8203;

이 날도 역시 주민진 배우님이 첫 등장부터 애드립 폭발했는데, 케일럽 집에 몰래 들어오는 순간 갑자기 문 밖을 보더니 "헤이! 헤이!! 대왕거북이!!!" 이러면서, 마치 케일럽 집까지 함께 여정을 했는데 대왕거북이가 갑자기 자신을 떠난 것처럼 행세했다ㅎㅎ 그걸 본 루이스의 어리둥절한 모습도 너무 웃겼고ㅋㅋㅋ

&#8203;

유령선 rep 전에 루이스가 잭을 찾던 중 메리가 나타나는 순간, 메리가 유령선에 대해 루이스에게 설명해주며 "선원들이 사라지기도 하고"라고 하니, 루이스가 "잭...?" "아니, 잭은 지금 자고있어." "영...원..히...?"에 객석 완전 터지고ㅋㅋㅋㅋ 메리가 무슨 일이냐고 물으니 "알려드리면 살려주시나요" "루이스는 살려주지~(다정)"에 또 터졌다ㅎ

&#8203;

이렇게 웃음포인트가 많은 페어인데, 마지막에 "우리 모두, 기억나지 않는 꿈" 직전 앤과 메리의 감정이 어찌나 좋았던지...메리는 앤이 오자마자 얼른 자신의 팔에서 나던 피를 슥슥 닦아보려고 애쓰고, 팔의 상처가 보이지 않게 몸을 틀어 앉는다...앤이 걱정할까봐ㅠㅠㅠ 그리고는 애써 괜찮은 척 하는데, 이 날은 두 사람 모두 감정이 북받쳐서ㅠㅠ 노래를 부르다가 살짝 목이 메이는 순간들이 있었는데, 그게 오히려 이 넘버를 더욱 살려주어 많은 관객들을 울렸다는 후문ㅠㅠㅠ

&#8203;

마지막에도 루이스가 "캡틴 잭의 뒷모습"이라고 노래를 하다가 울음이 나서 또 목이 메였는데, 그래서 이 날 앤매리/잭루이스의 관계가 더욱 끈끈하게 느껴져 너무나도 가슴아픈 공연이었다...ㅠㅠ 최고...ㅠㅠ 주석 최고

