&#8203;
려후페어 감정 진짜 좋은 것 같아요... 이후루이스/앤 막판에 엄청 우는데 그 감정이 온전히 느껴져서 지켜보는 관객마저 눈물이 나게 하는ㅠㅠ 대사 가사 실수가 좀 있어서 아쉽긴 했지만 려후페어 너무 좋았습니다!
&#8203;

아버진 어떻게 평샹 해적선을 탔을까~
떠나갈때마다 거짓말을 했지~
이번이 마지막 항해라고~&#127925;

항상 그렇듯이 해적들의 오열 넘버 우모기꿈은 오늘도 &#128079;&#128079;&#128079;
메리가 앤 밀쳐내는 장면도 그렇고
앤이랑 메리 눈물 떨구는 것도 그렇고
내 심장 쿵 떨어진다 진짜 &#128557;
